import React from 'react';
import SingleQuiz from './SingleQuiz';

function Quizzes({ quizzes }) {
  return (
    <div>
        console.log({quizzes})
      {quizzes.map(quiz => (
        <SingleQuiz
          key={quiz.id} {... quiz}
        />
      ))}
    </div>
  );
}

export default Quizzes;
